INSERT INTO `TEMARIOS` VALUES (1,1,'Álgebra Básica','El álgebra es una rama fundamental de las matemáticas que estudia las estructuras, relaciones y cantidades mediante el uso de símbolos y reglas.\n\nEn este temario, exploraremos los conceptos clave del álgebra, incluyendo expresiones algebraicas, ecuaciones, desigualdades y sistemas de ecuaciones. Aprenderemos a manipular expresiones algebraicas, resolver ecuaciones de primer y segundo grado, y aplicar estos conocimientos a problemas del mundo real.\n\nAdemás, se proporcionarán ejercicios prácticos y ejemplos detallados para fortalecer la comprensión de los estudiantes.','http://monlab.ddns.net/images/algebra.pdf','http://monlab.ddns.net/images/algebraBasica.jpg','http://monlab.ddns.net/images/videoplayback.mp4','2025-02-24 18:01:03','Álgebra básica'),(2,2,'Campo gravitatorio','Este temario explora las leyes fundamentales que rigen la atracción entre los cuerpos en el universo. Se estudiará la Ley de Gravitación Universal de Newton, la relación con las leyes de Kepler, el concepto de campo gravitatorio y potencial gravitatorio. Además, se analizarán aplicaciones en la astronomía, órbitas de los planetas y satélites, y cómo la relatividad general amplió nuestra comprensión de la gravedad.','avanzado.pdf','http://monlab.ddns.net/images/campo-gravitatorio.jpg','http://monlab.ddns.net/images/gravitacion.mp4','2025-02-24 18:01:03','Campo gravitatorio'),(3,2,'Cinemática','En este temario se estudiará el movimiento de los cuerpos sin considerar las causas que lo generan. Se analizarán conceptos fundamentales como posición, velocidad y aceleración en distintos tipos de movimiento (rectilíneo uniforme, uniformemente acelerado, circular y parabólico). Además, se trabajarán representaciones gráficas y ecuaciones de movimiento para describir trayectorias y resolver problemas físicos.','avanzado.pdf','https://apolonio.es/wp-content/uploads/2024/04/formula-velocitat.jpg','http://monlab.ddns.net/images/mru.mp4','2025-02-24 18:01:03','MRU MOVIMIENTO RECTILÍNEO UNIFORME'),(15,1,'Trigonometría','El álgebra es una rama fundamental de las matemáticas que estudia las estructuras, relaciones y cantidades mediante el uso de símbolos y reglas.En este temario, exploraremos los conceptos clave del álgebra, incluyendo expresiones algebraicas, ecuaciones, desigualdades y sistemas de ecuaciones. Aprenderemos a manipular expresiones algebraicas, resolver ecuaciones de primer y segundo grado, y aplicar estos conocimientos a problemas del mundo real.Además, se proporcionarán ejercicios prácticos y ejemplos detallados para fortalecer la comprensión de los estudiantes.','http://monlab.ddns.net/images/trigonometria.pdf','http://monlab.ddns.net/images/trigonometria.jpg','http://monlab.ddns.net/images/matrices.mp4','2025-03-27 15:40:07','Introducción trigonometría'),(19,2,'Dinámica','Este temario se centra en el estudio de las causas del movimiento de los cuerpos. Se abordarán las Leyes de Newton, las fuerzas fundamentales, la fricción, la tensión y las fuerzas normales. Se explorarán conceptos como el impulso, la cantidad de movimiento y su conservación, aplicándolos a situaciones del mundo real, desde el movimiento de vehículos hasta la interacción de objetos en diferentes sistemas físicos.',NULL,'https://calazansfemeninofisicayestaditicaa.wordpress.com/wp-content/uploads/2013/04/fuerza.jpg','http://monlab.ddns.net/images/dinamica.mp4','2025-03-27 15:41:03','Dinámica, conceptos básicos y ejemplos.'),(39,1,'Matrices','Este temario abarca los conceptos fundamentales de las matrices, desde su definición y operaciones básicas hasta aplicaciones en álgebra lineal. Aprenderás sobre los diferentes tipos de matrices, sus propiedades y cómo utilizarlas para resolver sistemas de ecuaciones. También exploraremos determinantes, inversas y transformaciones matriciales, con ejemplos prácticos y ejercicios para reforzar el aprendizaje. Al finalizar, tendrás una comprensión sólida de las matrices y su importancia en matemáticas y ciencias aplicadas.','http://monlab.ddns.net/images/matrices.pdf','https://dropinblog.net/34249715/files/portada-post/matrices-una-guia-completa.png','http://monlab.ddns.net/images/matrices.mp4','2025-04-02 16:10:17','Introducción matrices'),(40,11,'UF2 - El tejón de la miel','data:image/jpeg;base64,','actividad','https://i.pinimg.com/236x/27/c0/95/27c095b20ae408edbd89b06d759a3a97.jpg','http://monlab.ddns.net/images/tejonMiel.mp4','2025-04-02 16:28:38','UF2 El tejón de miel'),(43,11,'UF3 - El oso polar','osos','oso.pdf','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSyo-Q1h3h1IFujm2ljNawJW1wD8nMyKIl49w&s','http://monlab.ddns.net/images/osoPolar.mp4','2025-04-02 16:55:12','UF3 El oso polar'),(44,11,'UF4 - Los girasoles','girasoles','girasoles.pdf','https://www.compo.de/dam/jcr:fdbba870-e002-430c-8b2e-c635fcc8074e/sunflower-bee_sonneblume-biene.jpg?x=50&y=50','http://monlab.ddns.net/images/girasoles.mp4','2025-04-02 16:58:52','UF4 Los girasoles'),(45,11,'UF1 - Los bacalaos','bacalao','bacalaos.pdf','https://upload.wikimedia.org/wikipedia/commons/e/ee/Gadus_morhua_Cod-2b-Atlanterhavsparken-Norway.JPG','http://monlab.ddns.net/images/bacalaos.mp4','2025-04-02 17:07:06','UF1 Los bacalaos'),(47,3,'Mecánica de Fluidos','La mecánica de fluidos es una rama de la física que estudia el comportamiento de los líquidos y gases en reposo o en movimiento. Este temario proporciona una base sólida sobre los principios fundamentales que rigen la dinámica de fluidos.\n\nSe abordarán conceptos como la densidad, presión, principio de Pascal, principio de Arquímedes, ecuación de continuidad y la ecuación de Bernoulli. También se incluyen ejemplos de aplicaciones prácticas como el funcionamiento de sistemas hidráulicos, aviones, barcos y cañerías.\n\nIncluye explicaciones detalladas, problemas resueltos y ejercicios para aplicar los conceptos aprendidos.','http://monlab.ddns.net/images/fluidos.pdf','http://monlab.ddns.net/images/fluidos.jpg','http://monlab.ddns.net/images/fluidos.mp4','2025-04-02 17:08:45','Introducción a la Mecánica de Fluidos - Clase 1'),(48,3,'Reacciones Redox','Las reacciones de oxidación-reducción (Redox) son procesos fundamentales en química en los cuales ocurre una transferencia de electrones entre sustancias. Estas reacciones tienen aplicaciones en la corrosión, la combustión, las baterías y procesos biológicos.\n\nEste temario cubre los conceptos esenciales de las reacciones redox, incluyendo los números de oxidación, agentes oxidantes y reductores, el balanceo de ecuaciones redox por el método del ion-electrón y del cambio en el número de oxidación.\n\nSe incluyen ejemplos ilustrativos, problemas resueltos y ejercicios prácticos para dominar el tema.','http://monlab.ddns.net/images/redox.pdf','http://monlab.ddns.net/images/redox.jpg','http://monlab.ddns.net/images/redox.mp4','2025-04-02 17:12:00','Reacciones Redox: Introducción y Balanceo - Clase 1'),(49,3,'Enlace Químico','El enlace químico es el proceso mediante el cual los átomos se combinan para formar moléculas y compuestos. Comprender los tipos de enlaces y su formación es esencial para explicar las propiedades físicas y químicas de la materia.\n\nEste temario aborda los distintos tipos de enlaces: iónico, covalente y metálico, así como conceptos clave como la electronegatividad, la geometría molecular y la teoría del enlace de valencia. También se explorarán estructuras de Lewis y modelos de enlace para distintos compuestos.\n\nSe proporcionarán explicaciones claras, diagramas, ejercicios resueltos y actividades para reforzar la comprensión.','http://monlab.ddns.net/images/enlacesQuimicos.pdf','http://monlab.ddns.net/images/enlacesQuimicos.jpg','http://monlab.ddns.net/images/enlacesQuimicos.mp4','2025-04-02 17:14:33','Tipos de Enlace Químico - Clase 1'),(50,11,'UF5 - El cuerpo humano','cuerpo_humano','cuerpo.pdf','https://s1.significados.com/foto/partes-del-cuerpo-humano-og.jpg?class=ogImageWide','http://monlab.ddns.net/images/cuerpoHumano.mp4','2025-04-02 17:14:35','UF5 El cuerpo humano'),(51,11,'UF6 - Las células','células','célula.pdf','https://www.coldelvalle.edu.mx/wp-content/uploads/2024/03/5.Que_son_las_celulas-min.jpg','http://monlab.ddns.net/images/celulas.mp4','2025-04-02 17:17:51','UF6 Las células'),(63,11,'UF7 - El oso pardo','El oso pardo es un animal muy peligroso','http://monlab.ddns.net/images/bailey.jpeg','http://monlab.ddns.net/images/bailey.jpeg','http://monlab.ddns.net/images/videoplayback.mp4','2025-05-21 16:46:28','UF7 El oso pardo');
